-- =============================================
-- Menghapus tabel Orders jika sudah ada
DROP TABLE IF EXISTS Orders;

-- Membuat tabel Orders untuk menyimpan data pesanan
CREATE TABLE "orders" (
"order_id" TEXT,
  "customer_id" TEXT,
  "postal_code" INTEGER,
  "product_id" TEXT,
  "sales" TEXT,
  "quantity" INTEGER,
  "discount" REAL,
  "profit" TEXT,
  "category" TEXT,
  "subcategory" TEXT,
  "product_name" TEXT,
  "order_date" TEXT,
  "ship_date" TEXT,
  "ship_mode" TEXT,
  "customer_name" TEXT,
  "segment" TEXT,
  "country" TEXT,
  "city" TEXT,
  "state" TEXT,
  "region" TEXT
);

-- Menampilkan semua data dari tabel Orders
SELECT * FROM Orders; 
-- =============================================
-- Menampilkan nama konsumen segment Consumer yang pernah membeli meja
SELECT DISTINCT customer_name
FROM Orders
WHERE segment = 'Consumer'
  AND subcategory LIKE '%Table%';

-- =============================================
-- Menampilkan nama konsumen dari segmen Corporate dan Home Office
-- yang berasal dari Los Angeles dan bertransaksi selama tahun 2018
SELECT DISTINCT customer_name
FROM Orders
WHERE (segment = 'Corporate' OR segment = 'Home Office')
  AND city = 'Los Angeles'
  AND order_date LIKE '2018%';
  
-- =============================================
-- Membuat query untuk menampilkan transaksi yang merugikan di kota Los Angeles
-- pada tahun 2018 hingga 2019, diurutkan berdasarkan kerugian terbesar.
SELECT *
FROM orders
WHERE city = 'Los Angeles'
  AND profit < 0
  AND strftime('%Y', order_date) BETWEEN '2018' AND '2019'
ORDER BY profit ASC;

-- =============================================
-- Membuat query untuk menampilkan transaksi yang menguntungkan di kota Henderson
-- selama Q1 tahun 2018, diurutkan berdasarkan keuntungan terbesar.

SELECT *
FROM orders
WHERE city = 'Henderson'
  AND profit > 0
  AND order_date >= '2018-01-01'
  AND order_date <= '2018-03-31'
ORDER BY profit DESC;

-- =============================================
-- Jawaban Nomor 1
-- Membuat query untuk memeriksa apakah satu nama konsumen memiliki lebih dari satu customer_id
SELECT customer_name, 
       COUNT(DISTINCT customer_id) AS unique_customer_ids
FROM orders
GROUP BY customer_name
HAVING COUNT(DISTINCT customer_id) > 1;

-- =============================================
-- Jawaban Nomor 2
-- Membuat query untuk mencari produk (product_name) yang paling best selling berdasarkan kuantitas
SELECT product_name, 
       SUM(quantity) AS total_quantity
FROM orders
GROUP BY product_name
ORDER BY total_quantity DESC
LIMIT 1;

-- =============================================
-- Jawaban Nomor 3
-- Membuat query untuk mencari produk yang paling merugikan selama tahun 2017
SELECT product_name, 
       SUM(profit) AS total_profit
FROM orders
WHERE strftime('%Y', order_date) = '2017'
GROUP BY product_name
ORDER BY total_profit ASC
LIMIT 1;

